@pytest.mark.parametrize('aliases', [
    'cut,git,sed',
    'cut, git, sed',
    ' cut,\tgit,sed\n',
    '\ncut,\n\ngit,\tsed\r'])
def test_get_overridden_aliases(self, shell, tf_overridden):
    assert shell._get_overridden_aliases() == {'cd', 'cut', 'git', 'grep',
                                               'ls', 'man', 'open', 'sed'}

